
<h2>EmbeddedProgram</h2>
<ul class="parameter">
  <li class="param-required-false">id : String
    <br/>Identifier of the program. Unique within the space.
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">name : String
    <br/>Name of the program
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">enabled : Boolean
    <br/>Whether this Program has been enabled for Cloud Manager usage
  </li>
</ul>
<ul class="parameter">
  <li class="param-required-false">tenantId : String
    <br/>Tenant Id
  </li>
</ul>
